import React , {useState} from "react";
import { Col, Container, Row } from "react-bootstrap";

const NewMain2 = () => {
    return(
        <>
        {/* Main Div */}
        <Container className="main-style mt-5 mb-5">
             {/* Start coDe */}
             <Row>
                 {/* 1st Column */}
                 <Col xs={6}>
                     <Row>
                         <Col style={{color: red}}>Personal Detail</Col>
                         <Col>Professional Detail</Col>
                     </Row>
                 </Col>
                 {/* 2d Column*/}
                 <Col xs={6}> Name</Col>
             </Row>

        </Container>
        </>
    )
}
export default NewMain2
